export function leader_line(src_id, dest_id, opts) {
    const src_element = document.getElementById(src_id);
    const dest_element = document.getElementById(dest_id);

    if (src_element != null && src_element != null) {
        return new LeaderLine(src_element, dest_element, opts);
    } else {
        return null;
    }
}
